import React, { useEffect, useState } from 'react';
import API from '../utils/api';
import NestEggChart from '../components/NestEggChart';

function Dashboard() {
  const [userData, setUserData] = useState({
    scenarioName: "My Scenario",
    currentYear: new Date().getFullYear(),
    currentAge: 30,
    retirementAge: 70,
    currentSalary: 60000,
    annualContribution: 10,
    salaryGrowthRate: 2,
    currentNestEgg: 0,
    rateOfReturnBeforeRetirement: 4.5,
    spendingAtRetirement: 44000,
    slowdownAge: 80,
    spendingAtSlowdown: 44000,
    rateOfReturnInRetirement: 4,
    inflationInRetirement: 1.5,
  });
  
  const [projectionData, setProjectionData] = useState(null);
  const [savedScenarios, setSavedScenarios] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    API.get('/api/scenarios')
      .then(response => {
        setSavedScenarios(response.data);
        setError(null);
      })
      .catch(() => setError("Failed to load scenarios"));
  }, []);

  const calculateProjections = async () => {
    try {
      const response = await API.post('/api/calculate', userData);
      setProjectionData(response.data);
      setError(null);
    } catch (err) {
      setError("Failed to calculate projections");
    }
  };

  const saveScenario = async () => {
    try {
      await API.post('/api/scenarios', userData);
      const response = await API.get('/api/scenarios');
      setSavedScenarios(response.data);
      setError(null);
    } catch (err) {
      setError("Failed to save scenario");
    }
  };

  const handleChange = (e) => {
    const { name, value, type } = e.target;
    setUserData(prev => ({
      ...prev,
      [name]: type === "number" ? parseFloat(value) || 0 : value
    }));
  };

  return (
    <div className="p-6 max-w-7xl mx-auto grid grid-cols-1 lg:grid-cols-2 gap-6">
      {/* Calculator Form */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-2xl font-bold mb-6">Retirement Calculator</h2>
        
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-700 mb-1">Scenario Name</label>
          <input
            type="text"
            name="scenarioName"
            value={userData.scenarioName}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>

        <div className="grid grid-cols-2 gap-4">
          {Object.entries(userData)
            .filter(([key]) => key !== "scenarioName")
            .map(([key, value]) => (
            <div key={key} className="mb-4">
              <label className="block text-sm font-medium text-gray-700 mb-1">
                {key.replace(/([A-Z])/g, ' $1').toLowerCase()}
              </label>
              <input
                type="number"
                name={key}
                value={value}
                onChange={handleChange}
                className="w-full p-2 border rounded"
              />
            </div>
          ))}
        </div>

        <div className="mt-6 space-y-4">
          <button
            onClick={calculateProjections}
            className="w-full bg-blue-600 text-white py-2 px-4 rounded"
          >
            Calculate Projections
          </button>
          {projectionData && (
            <button
              onClick={saveScenario}
              className="w-full bg-green-600 text-white py-2 px-4 rounded"
            >
              Save Scenario
            </button>
          )}
        </div>
      </div>

      {/* Results and Chart */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-2xl font-bold mb-6">Retirement Projections</h2>
        {projectionData ? (
          <>
            <div className="grid grid-cols-2 gap-4 mb-6">
              <div className="p-4 bg-blue-50 rounded-lg">
                <p className="text-sm text-blue-600">Final Balance</p>
                <p className="text-2xl font-bold text-blue-900">
                  ${projectionData.slice(-1)[0]?.ending_balance?.toLocaleString() || '0'}
                </p>
              </div>
            </div>
            <NestEggChart dataPoints={projectionData} />
          </>
        ) : (
          <p>No projection data available</p>
        )}
        {error && (
          <div className="mt-4 p-4 bg-red-50 text-red-600 rounded-lg">
            {error}
          </div>
        )}
      </div>

      {/* Saved Scenarios */}
      {savedScenarios.length > 0 && (
        <div className="col-span-1 lg:col-span-2 bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-bold mb-6">Saved Scenarios Comparison</h2>
          <NestEggChart 
            dataPoints={savedScenarios.map(scenario => {
              try {
                const parsedData = JSON.parse(scenario.projection_data);
                if (Array.isArray(parsedData)) {
                  return parsedData.map(d => ({ year: d.year, balance: d.ending_balance }));
                } else if (parsedData.years) {
                  return parsedData.years.map(d => ({ year: d.year, balance: d.balance }));
                }
              } catch (error) {
                console.error("Failed to parse projection_data:", error);
              }
              return [];
            })}
            multipleScenarios={true}
          />
        </div>
      )}
    </div>
  );
}

export default Dashboard;
